import React, { Component } from 'react';
export class NavBar extends Component{
    render (){
        return (
            <>
                <ul style={{display:"flex", listStyleType:"none"}}>
                    <li style={{marginLeft:"10px"}}><a href="https://www.google.com" >Home</a></li>
                    <li style={{marginLeft:"10px"}}><a href="https://www.google.com" >About</a></li>
                    <li style={{marginLeft:"10px"}}> <a href="https://www.google.com" >Order</a></li>
                    <li style={{marginLeft:"10px"}}> <a href="https://www.google.com" >Contact</a></li>
                </ul>
                <button onClick={this.props.handleClick}>Click</button>
            </>
        );
    }
}
